import '../../App.css';
import React, { Component } from 'react';
import { ReactSVG } from 'react-svg';

import background from '../../svg/Background.svg';
import appliances from '../../svg/mainMenu/menuAppliances.svg';
import schedule from '../../svg/mainMenu/menuSchedule.svg';
import cancel from '../../svg/mainMenu/menuCancel.svg';
import energy from '../../svg/mainMenu/menuEnergy.svg';

class Menu extends Component {
  // handle svg file with arrows
  constructor(props) {
    super(props)
    this.page = { page: 1}
    this.pages = {pages: [energy, schedule, appliances, cancel]}
  }
  
  
  render(){

    return (
      <div className="equi">
        <ReactSVG
          afterInjection={(error, svg) => {
            if (error) {
              console.error(error)
              return
            }
            console.log(svg)
          }}
          className="wrapper-class-name"
          evalScripts="always"
          fallback={() => <span>Error!</span>}
          loading={() => <span>Loading</span>}
          onClick={() => {
            console.log('wrapper onClick')
          }}
          renumerateIRIElements={false}
          src={background}
          useRequestCache={false}
          wrapper="span">
        <h1> HELLO </h1>
        </ReactSVG>
        {/*</div>*/}
      </div>
    );
  }
}

export default Menu;
